import React from 'react';

import './PlayTable.css';
import TrickCard from './TrickCard/TrickCard';
const cardFolder= '/cards/'



const PlayTable = ({trick, players}) => {
    console.log('players');
    console.log(players);
    const playersArray = players.players? players.players : [];
    return (
    <div className="playTable">
        {trick ? (
        <div>
            <div className="activeContainer">
                {trick.map ((card, index) => (
                    <TrickCard index={index} card={card} player={playersArray[index] ? playersArray[index] : 'empty Chair'}/>
                   // console.log('user in room: ' + user.name)
                ))}
            </div>
        </div>
        ) : null }
    </div>
    )
};


export default PlayTable;
